import React, { Component } from 'react'

 class Acc_edit extends Component {
  render() {
    return (
      <div className="acc_edit" id='active'>
    <h3 className="title">REPLACE{this.props.field}</h3>
      <input type={this.props.type} placeholder="ENTER THE NEW CONTENT" className="edit-i"/>
      <button type="submit" className="editsub">UPDATE</button>
      </div>
    )
  }
}

export default Acc_edit
